                                <a href=""#faq-nhung-cau-hoi-thuong-gap""><h2>FAQ – Những lưu ý khi giao dịch tại Cần thu&#234; căn hộ chung cư Việt Nam :</h2></a><ul>
                                    <li><a href=""#1-mua-ban-nha-trong-khu-dan-cu-hien-huu-can-luu-y-gi"">1. 1/ Mua bán nhà trong khu dân cư hiện hữu cần lưu ý gì?</a></li>
