                                    <li><a href=""#4-mua-ban-dat-nen-lien-ke-dat-du-dan-can-luu-y-gi"">1. 4/ Mua bán đất nền, liền kề, đất dự án cần lưu ý gì?</a></li>
                                    <li><a href=""#5-thue-nha-mat-tien-nha-trong-ngo-hem-can-luu-y"">1. 5/ Thuê nhà mặt tiền, nhà trong ngõ hẻm cần lưu ý gì?</a></li>
                                    <li><a href=""#6-thue-cho-thue-can-ho-chung-cu-can-luu-y-gi"">1. 6/ Thuê, cho thuê căn hộ Chung cư cần lưu ý gì?</a></li>
                                    <h2 id=""faq-nhung-cau-hoi-thuong-gap""><div class=""desciption-content""><strong>FAQ – Những lưu ý khi giao dịch tại Cần thu&#234; căn hộ chung cư Việt Nam:</strong></h2>
                                    <h3 id=""1-mua-ban-nha-trong-khu-dan-cu-hien-huu-can-luu-y-gi"">1/ Mua bán nhà trong khu dân cư hiện hữu cần lưu ý gì?</h3>
                                    <p>
                                        Giai đoạn tìm hiểu và đàm phán:
                                      ");
            WriteLiteral(@"  Tìm hiểu giấy tờ pháp lý của tài sản là thật hay giả.
                                        Kiểm tra tài sản trên thực tế và tài sản trên giấy chứng nhận.
                                        Tìm hiểu nhà đất bán có bị tranh chấp với hàng xóm liền kề hay tranh chấp giữa các đồng sở hữu hoặc với người khác.
                                        Kiểm tra người đứng tên tài sản vợ/chồng có gặp khó khăn trong việc ký tên chuyển nhượng không.
                                        Tìm hiểu ở Phòng công chứng xem tài sản có đang liên quan đến một giao dịch khác như đặt cọc, cầm cố, bảo lãnh, ủy quyền… hay không?
                                        Kiểm tra giấy tờ tùy thân có còn trong hạn sử dụng hay không.
                                        Kiểm tra giấy chứng nhận có ghi nợ các khoản lệ phí trước bạ, tiền sử dụng đất,..
                                        Kiểm tra việc mua bán có biểu hiện giấu giếm, vội vàng, giá cả mua bán có quá rẻ không
                                        T");
            WriteLiteral(@"ìm hiểu tài sản có liên quan đến bên thứ ba như hệ thống cống, cáp điện, cấp nước…
                                        Giai đoạn ký hợp đồng, thanh toán:
                                        Hạn chế việc mua bán viết tay, nếu tài sản đã có giấy chứng nhận nên đến phòng công chứng để làm hợp đồng mua bán.
                                        Việc đặt cọc, mua bán nên mời người làm chứng.
                                        Việc thanh toán cần thực hiện tại ngân hàng, không nên thanh toán ở địa điểm khác.
                                        Hạn chế việc đặt cọc, mua bán bằng ngoại tệ bởi việc mua bán này có thể bị vô hiệu, gây thiệt hại cho các bên.
                                        Ngay sau khi ký hợp đồng công chứng, một trong các bên phải liên hệ nộp thuế với cơ quan thuế để tránh bị phạt do chậm nộp.
                                        Khi nhận Giấy chứng nhận (cấp cho bên mua) cần kiểm tra các thông tin ghi trên giấy chứng nhận có chính xác không. Nếu phát hiện sai sót ph");
            WriteLiteral(@"ải đề nghị đính chính ngay..
                                    </p>
                                    <h3 id=""2-mua-ban-can-ho-chung-cu-can-luu-y-gi"">2/ Mua bán căn hộ chung cư cần lưu ý gì?</h3>
                                    <p>
                                        Chủ đầu tư uy tín: Bạn phải tỉnh táo và tìm hiểu thật kỹ lưỡng xem Chủ đầu tư đó có được Ngân hàng đứng ra bảo lãnh tiến độ xây dựng của dự án hay không hoặc chủ đâu tư có uy tín và tiềm lực tài chính lớn
                                        Khả năng tài chính: Cần cân nhắc khả năng tài chính của chính mình để có sự lựa chọn phù hợp nhất.
                                        Vị trí: Cụ thể là khoảng cách từ dự án đến trung tâm thành phố, nơi làm việc, học tập và các tiện ích cần thiết như chợ, siêu thị… là bao xa.
                                        Phương thức thanh toán: phương thức thanh toán linh hoạt được các chủ đầu tư tận dụng như lá 1 yếu tố để thu hút khách hàng. Đây là yếu tố được rất nhiều gia đình trẻ có t");
            WriteLiteral(@"hu nhập trung bình chú ý để vừa phải cân bằng giữa chi tiêu trong sinh hoạt và thanh toán cho chủ đầu tư.
                                        Tiến độ xây dựng: nên lựa chọn các dự án có cam kết mạnh mẽ và cụ thể thời gian về từng giai đoạn thi công. Đặc biệt là những dự án cam kết tiến độ thi công song song với tiến độ đóng tiền.
                                        Pháp lý/ Hợp đồng: Cần tham khảo Hợp đồng mua bán / Hồ sơ pháp lý trước khi đặt bút ký vào hợp đồng. Cần phân tích ở những điểm: Giá cả phải minh bạch, rõ ràng, thanh toán ở những mốc thời gian cụ thể. Yêu cầu chủ đầu tư cho xem về giấy tờ pháp lý liên quan như: giấy phép xây dựng, giấy phép đầu tư, sổ đỏ dự án…Nếu là căn hộ trả góp cần hỏi kỹ lưỡng những giấy tờ cần thiết, điều kiện vay, lãi suất thay đổi như thế nào?
                                        Phí chung cư, tiện ích: Bạn nên tìm hiểu các loại phí chung cư cần phải trả hàng tháng có phù hợp hoặc chấp nhận được không? Phí chung cư hiện nay là vấn đề các bạn phải cân nhắc thi");
            WriteLiteral(@"ệt kỹ trước khi mua. Cần xem xét kĩ các vấn đề như: chỗ gởi xe máy, xe hơi, chỗ sinh hoạt công cộng, nhà cung cấp dịch vụ internet, cáp, điện thoại, bể bơi, trung tâm thể dục, thang máy….và các tiện ích khác. Phí quản lý chung cư: tùy thuộc vào tiêu chuẩn của dự án sẽ có 1 mức phí khác nhau nhưng đều không vượt quá mức trần của nhà nước quy định
                                        Sau khi quyết định mua một căn hộ chung cư nào đó, bạn nên xin một bản copy hợp đồng về đọc, phân tích kỹ lưỡng.
                                    </p>
                                    <h3 id=""3-Mua-ban-dat-tho-cu-dat-o-can-luu-y-gi"">3/ Mua bán đất thổ cư, đất ở cần lưu ý gì?</h3>
                                    <p>
                                        Tìm hiểu về mảnh đất cần mua
                                        Khu dân sinh có tốt không, giao thông có thuận lợi không, để thuận tiện trong cuộc sống, bạn nên chọn những khu đất gần trường học, bệnh viện, chợ, ...
                                        C");
            WriteLiteral(@"họn hướng phù hợp với bạn nếu bạn tin vào phong thủy chọn hoặc bạn mảnh đất nằm ở hướng Nam hay Đông Nam là tốt nhất. Đây là hai hướng khí hậu ôn hòa, rất tốt để xây nhà. Vì thế, dân gian có câu ""lấy vợ hiền hòa, làm nhà hướng Nam"".
                                        Tới Sở Tài Nguyên Môi trường hỏi xem mảnh đất đó có nằm trong diện quy hoạch không, hoặc khu vực đó có dự án nào không.
                                        Giấy chứng nhận quyền sử dụng đất hợp pháp, điều này rất quan trọng bởi nó quyết định đến tính pháp lý của mảnh đất.
                                        Không có tranh chấp lối đi vào: Tại các đô thị lớn có rất nhiều mảnh đất mà lối vào đang xảy ra tranh chấp chưa thể giải quyết.
                                        Giai đoạn ký hợp đồng, thanh toán:
                                        Hạn chế việc mua bán viết tay, nếu tài sản đã có giấy chứng nhận nên đến phòng công chứng để làm hợp đồng mua bán.
                                        Việc đặt cọc, mua bán nên mời ");
            WriteLiteral(@"người làm chứng.
                                        Việc thanh toán cần thực hiện tại ngân hàng, không nên thanh toán ở địa điểm khác.
                                        Hạn chế việc đặt cọc, mua bán bằng ngoại tệ bởi việc mua bán này có thể bị vô hiệu, gây thiệt hại cho các bên.
                                        Ngay sau khi ký hợp đồng công chứng, một trong các bên phải liên hệ nộp thuế với cơ quan thuế để tránh bị phạt do chậm nộp.
                                        Khi nhận Giấy chứng nhận (cấp cho bên mua) cần kiểm tra các thông tin ghi trên giấy chứng nhận có chính xác không. Nếu phát hiện sai sót phải đề nghị đính chính ngay.
                                    </p>
                                    <h3 id=""4-mua-ban-dat-nen-lien-ke-dat-du-dan-can-luu-y-gi"">4/ Mua Đất nền, liền kề, đất dự án cần lưu ý gì?</h3>
                                    <p>
                                        Chủ đầu tư: khi mua đất nền dự án là cần phải chọn chủ đầu tư có uy tín, thực hiện n");
            WriteLiteral(@"hiều công trình tốt và có trách nhiệm với khách hàng, có nguồn vốn mạnh mẽ.
                                        Vị trí: mảnh đất đó có gần nơi làm việc hay không, có gần siêu thị hay trường học cho con cái của bạn đi học hay không, nơi đó có yên tĩnh không, các phương tiện giao thông đi qua, chỗ đậu xe, nơi mua sắm...
                                        Pháp lý: Người bán phải có đầy đủ giấy tờ chứng minh quyền sử dụng hợp pháp. Nếu là đất được thừa kế, phải tìm hiểu kỹ những người thừa kế khác có tranh chấp hay không. Pháp lý minh bạch, rõ ràng là ưu tiên hàng đầu trong thời điểm hiện nay.
                                        Không nên mua đất sổ chung: Vì nếu sau này xảy ra tranh chấp thì sẽ rất phiền phức cho 2 bên và gần như không giải quyết triệt để được.
                                        Cơ sở hạ tầng: Cơ sở hạ tầng đã hoàn thiện hay đang trong giai đoạn hoàn thiện, các dự án có cơ sở hạ tầng hoàn thiện được khách hàng ưu tiên trước vì có thể đáp ứng được nhu cầu ở, kinh doanh, hoặc");
            WriteLiteral(@" đầu tư.
                                        Tránh tin vào tâm lý đám đông: Các bạn nên lưu ý đừng thấy nhiều người cùng thực hiện một việc mà tin tưởng rằng việc đó là đúng. Trong việc mua đât nền dự án cũng vậy, để hiệu quả, bạncần thu thập đầy đủ thông tin về chủ đầu tư, dự án và nếu có thể nhờ đến sự tư vấn của chuyên gia để hạn chế rủi ro.
                                        Hợp đồng: Nội dung hợp đồng phải được ghi rõ ràng, đầy đủ các thông tin cần thiết: phương thức thanh toán, thời hạn thanh toán, thời hạn giao đất, đặc biệt là các điều khoản phạt như mức đền bù thiệt hại nếu chủ đầu tư vi phạm tiến độ, quy hoạch thay đổi, người mua trễ hạn nộp phí thì giải quyết thế nào, …
                                    </p>
                                    <h3 id=""5-thue-nha-mat-tien-nha-trong-ngo-hem-can-luu-y"">5/ Thuê nhà mặt tiền, nhà trong ngõ hẻm cần lưu ý gì?</h3>
                                    <p>
                                        Trước khi đến xem nhà cần xác minh người đang ");
            WriteLiteral(@"liên hệ là chủ nhà hay nhà môi giới để tránh mất tiền vô ích. Nên hỏi trước những thông tin cơ bản như địa chỉ cụ thể, giá thuê, tiền điện, nước,…
                                        Vị trị nhà: Dò hỏi xung quanh để biết được tình hình ngập lụt, an ninh, ồn ào hay nhà bạn định thuê có gặp vấn đề gì không. Bạn muốn thuê nhà để kinh doanh, chắc chắn phải xem xét căn nhà có nằm ở vị trí sầm uất không, có phù hợp với ngành nghề bạn muốn kinh doanh không.
                                        Xác minh chủ nhà: kiểm tra chắc chắn rằng người ký hợp đồng với bạn là chủ nhà và có quyền cho bạn thuê nhà. Cần yêu cầu chủ nhà trình giấy tờ để xác nhận tư cách thực của chủ nhà.
                                        Tiền thuê: Tiền thuê là bao nhiêu? Nộp lúc nào? Thời hạn thuê bao lâu? Có cam kết không tăng giá trong thời gian thuê không?
                                        Tiền đặt cọc: có cần đặt cọc trước hay không, số tiền bao nhiêu, khi nào thì được lấy lại cọc?
                                       ");
            WriteLiteral(@" Chi phí khác: tiền điện, tiền nước, internet, cáp và những chi phí phát sinh khác (nếu có)…
                                        Chấm dứt hợp đồng: Có thể chấm dứt hợp đồng trước thời hạn không? Cần phải báo trước bao nhiêu ngày? Thời gian được hoàn lại tiền đặt cọc (nếu có).
                                        Thiết bị gia dụng: Kiểm tra tình trạng những đồ gia dụng và thiết bị được chủ nhà cung cấp? .
                                    </p>
                                    <h3 id=""6-thue-cho-thue-can-ho-chung-cu-can-luu-y-gi"">6/ Thuê, cho thuê căn hộ Chung cư cần lưu ý gì?</h3>
                                    <p>
                                        Liên hệ trước khi đến xem nhà, xác nhận người đang liên hệ chủ nhà hay nhà môi giới. Xác định phí dịch vụ (nếu có) khi dẫn đi xem nhà, nếu tốn phí tốt nhất nên tìm nhà cho thuê khác. Hỏi các thông tin cơ bản như địa chỉ cụ thể, giá cho thuê, tiền điện, tiền nước nước,... Mỗi chung cư chỉ dùng một đường truyền Internet và truyền hình cáp,");
            WriteLiteral(@" người thuê cần cân nhắc xem có phù hợp với nhu cầu sử dụng của mình không. Nên tìm hiểu nhiều chung cư để tham khảo mức giá và tránh bị “hét” giá.
                                        Vị trí: Dò hỏi xung quanh để xem tình hình ngập lụt, an ninh nơi thuê. Cần xem xét nơi thuê có gần trường học bạn đang học, gần nơi làm việc, siêu thi hay chợ hay không, có các tuyến xe đi đến các địa điểm bạn thường tới không, giao thông có thuận tiện hay không…
                                        Xác minh chủ nhà: kiểm tra chắc chắn rằng người ký hợp đồng với bạn là chủ nhà và có quyền cho bạn thuê nhà. Cần yêu cầu chủ nhà trình giấy tờ để xác nhận tư cách thực của chủ nhà.
                                        Tiền thuê: Tiền thuê là bao nhiêu? Nộp lúc nào? Thời hạn thuê bao lâu?
                                        Tiền đặt cọc: có cần đặt cọc trước hay không, số tiền bao nhiêu, khi nào thì được lấy lại cọc?
                                        Chi phí khác: Tiền điện, tiền nước, internet, phí giữ xe, ph");
            WriteLiteral(@"í thang máy và các chi phí khác nếu có? Nên yêu cầu chủ nhà liệt kê chi tiết tất cả các khoản phí phải đóng và bạn chỉ thực hiện đúng như hợp đồng.
                                        Chấm dứt hợp đồng: Có thể chấm dứt hợp đồng trước thời hạn không? Cần phải báo trước bao nhiêu ngày? Thời gian được hoàn lại tiền đặt cọc (nếu có).
                                        Những ràng buộc đặc biệt: xác định chủ nhà có yêu cầu hay quy định gì không ( ví dụ như được nuôi thú không, được tiếp khách không…).
                                    </p>
